import React, { Component } from 'react';
import CharCard from './CharCard';
import axios from 'axios';
import './json';



export default class CharList extends Component {

    state={
        url: './json',
        character: null
    };

    componentDidMount(){
        const res = axios.get(this.state.url);
        this.setState({character: res.data['results']})
    }

    render(){
        return(
            <div className="row">           
                <CharCard />
                <CharCard />
                <CharCard />
                <CharCard />
                <CharCard />
                <CharCard />
                <CharCard />
                <CharCard />
                <CharCard />
                <CharCard />
                <CharCard />

            </div>
        );      
    }   
}
